import Navbar from "./components/Navbar";
import Heading from "./components/Headings";
import Intro from "./components/Intro";
import Experience from "./components/Experience";
import Project from "./components/Project";
import Technology from "./components/Technology";
import Contact from "./components/Contact";

function App() {
  return (
    <div className="App">
      <Navbar />

      <Intro />
      <Heading title="Where Iâ€™ve worked" />
      <Experience
        title="Frontend Engineer"
        duration=""
        org="Modumate"
        bullets={[
          [
            "Worked as the only ",
            <span>self-managed</span>,
            " frontend engineer of the team.",
          ],
          [
            "Used ",
            <span> Vue and Vuex</span>,
            "to create new critical features for the product which directly affected 3000 enterprise users",
          ],
          "Helped collect engagement statistics for marketing by writing SQL queries and using Google Analytics",
        ]}
      />

      <Project />
      <Technology />
      <Contact />
    </div>
  );
}

export default App;
